    text-align: center;
    padding-top: 5%;
}

#about .skills h3 {
    text-align: center;
    padding-top: 5%;
    float: right;
}

.info {
    width: 50%;
    float: left;
    margin-left: 2%;
}

#about img:hover {
    transform: scale(1.1);
    -webkit-transform: scale(1.1);
    -moz-transform: scale(1.1);
    -o-transform: scale(1.1);
}

#about figcaption {
    float: left;
    margin-top: 30%;
    text-align: justify;
    margin-left: 6%;
}

#about h4 {
    font-size: 25px;
