    width: 60%;
    text-align:justify;
    margin-left: auto;
    margin-right: auto;
}


/* WORK ******/

#work {
    background-color: #3f3f3f;
}

#work .white h1 {
    color: #f5f5f5;
    text-align: center;
    padding: 3%;
    float: right;
}

/* PROJECTS ******/

#projects {
/*     display: flex; 
    align-items: center;  
